import React from 'react';
import TextField from '@material-ui/core/TextField';
import { makeStyles, createStyles, Theme } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';

const useStyles = makeStyles((theme: Theme) =>
  createStyles({
    middle: {
      border: '1px solid rgb(228, 228, 228)',
    },
    input: {
      width: '100%',
    },
    bottom: {
      '& > *': {
        margin: theme.spacing(1),
      },
      border: '1px solid rgb(228, 228, 228)',
    },
    createBtn: {
      backgroundColor: 'rgb(255, 229, 0)',
      borderRadius: '50px',
      fontSize: '12px',
      color: 'rgb(66, 54, 48)',
    },
    cancelBtn: {
      backgroundColor: 'white',
      borderRadius: '50px',
      fontSize: '12px',
      color: 'rgb(66, 54, 48)',
    },
  })
);

export default function CreateChatroom() {
  const classes = useStyles();
  return (
    <div className="create-chatroom">
      <div className="create-chatroom-title">Create Chatroom</div>
      <div className={classes.middle}>
        <TextField
          className={classes.input}
          id="outlined-basic"
          label="Type room name"
          variant="outlined"
        />
      </div>
      <div className={classes.bottom}>
        <Button className={classes.createBtn} variant="contained">
          Create
        </Button>
        <Button className={classes.cancelBtn} variant="contained">
          Cancel
        </Button>
      </div>
    </div>
  );
}
